BEGIN TRANSACTION;
CREATE TABLE measurement (
                    serial INTEGER PRIMARY KEY NOT NULL,
                    id INTEGER type NOT NULL,
                    latitude REAL,
                    longitude REAL,
                    state TEXT,
                    date TEXT,
                    wind_heading REAL,
                    wind_speed_avg REAL,
                    wind_speed_max REAL,
                    wind_speed_min REAL);
COMMIT;
